text:
На каком языке написан данный фрагмент кода?
```
case WM_PAINT:
	{ 		PAINTSTRUCT
ps;
		BeginPaint(
			hWnd,
	&ps)
	; paint(
		hWnd); EndPaint(hWnd, &
ps); return 0;
	} case   WM_SIZE:
		mutator::resize(   {LOWORD( lParam) ,HIWORD(lParam) 
	});return 0  ;
	case WM_TIMER
	: if (!run_timer)
	  return 0; switch(wParam) {
		case 1: n_timer1000->
		  run(0, n_timer1000 ,flag_run
			  //
			);
			if (!master_obl_izm.empty()) paint(hWnd);
			break;
		case 2:n_timer250
		  ->run
	(0, n_timer250, flag_run); break;
		        }
return 0;
```

Объясни что делает код ниже:
```
def bubbleSort(arr):
    n = len(arr)
    swapped = False
    for i in range(n-1):
        for j in range(0, n-i-1):
            if arr[j] > arr[j + 1]:
                swapped = True
                arr[j], arr[j + 1] = arr[j + 1], arr[j]

        if not swapped:
            return
```

При обучении детей языку, их учат разбирать текст. Один из видов разбора - фонетический. При фонетическом разборе в письменном виде делают следующее:
1. Выписывают слово и его транскрипцию; 
2. Разбивают слово на отдельные слоги и выделяют ударение;
3. Выписываются звуки, для гласных указывается ударный или безударный, для согласных - глухой или звонкий (б/п, в/ф, г/к, д/т), твердый или мягкий (в таком случае, за буквой ставят апостроф, например: ч'), а также парность (непарные глухие - ц, ч, х, ц, й, непарные звонкие - р, л, м, н).
Пример транскрипции: солнце [сонцэ]. Теперь сделай разбиение на слоги и выдели ударный слог.

Отформатируй код ниже:
```c
case WM_PAINT:
	{ 		PAINTSTRUCT
ps;
		BeginPaint(
			hWnd,
	&ps)
	; paint(
		hWnd); EndPaint(hWnd, &
ps); return 0;
	} case   WM_SIZE:
		mutator::resize(   {LOWORD( lParam) ,HIWORD(lParam) 
	});return 0  ;
	case WM_TIMER
	: if (!run_timer)
	  return 0; switch(wParam) {
		case 1: n_timer1000->
		  run(0, n_timer1000 ,flag_run
			  //
			);
			if (!master_obl_izm.empty()) paint(hWnd);
			break;
		case 2:n_timer250
		  ->run
	(0, n_timer250, flag_run); break;
		        }
return 0;
```
